import { Column } from "primereact";
import React from "react";
import { IEmployee } from "../../models/IEmployee";

export const ItemsEmployee = ({
  deparment,
  hours_extra,
  salary,
  id_person,
  id_employee,
}: IEmployee) => {
  return (
    <React.Fragment>
      <div>helloworld</div>
      <Column field={id_employee} header="Identificacion"></Column>
      <Column field={id_person} header="Nombre persona"></Column>
      <Column field={deparment} header="Departamento"></Column>
    </React.Fragment>
  );
};
